import React, { useContext } from 'react'
import { DataContext } from '../Context/DataContext';
import { ContextType } from './Display';

type Headers = "email_address" | "first_name" | "last_name";

export const Table = () => {
  const typedContext = DataContext<ContextType>()
  const { data } = useContext(typedContext)
  const headers: Headers[] = data?.data?.customers[0] ? Object.keys(data.data.customers[0] as Header) : [] as Headers[];
  return (
    <div className='tableContainer' style={{ color: 'black' }}>
      {
        <table className='table'>
          <thead>
            <tr className='tr'>
              {headers.map(header => (<th>{header}</th>))}
            </tr>
          </thead>
          <tbody>
            {data &&
              (data?.data?.customers || []).map((row, index: number) => (
                <tr key={index}>
                  {headers.map((header, ind) => (
                    <td key={ind} className="td">
                      {row[header]}
                    </td>
                  ))}
                </tr>
              ))
            }
          </tbody>
        </table>
      }
    </div>
  )
}

export default Table;
